import React, { useState } from "react";
import axios from "axios";
import "./Register.css";

const App = () => {
  const [formData, setFormData] = useState({
    username: "",
    password: "",
    confirmPassword: "",
    email: "",
    phoneNumber: "",
  });

  const [message, setMessage] = useState("");
  const [validUsername, setValidUsername] = useState(true);
  const [validPassword, setValidPassword] = useState(true);
  const [validPasswordMatch, setValidPasswordMatch] = useState(true);
  const [validEmail, setValidEmail] = useState(true);
  const [validPhoneNumber, setValidPhoneNumber] = useState(true);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (formData.username.length < 6) {
      setValidUsername(false);
    }
    if (formData.password !== formData.confirmPassword) {
      setValidPasswordMatch(false);
    }

    if (formData.password.length < 6) {
      setValidPassword(false);
    }

    if (formData.phoneNumber.length !== 11) {
      setValidPhoneNumber(false);
    }

    if (!formData.email.includes("@")) {
      setValidEmail(false);
    }
    console.log(validUsername, validPassword, validPasswordMatch, validEmail, validPhoneNumber)
    if (
      !validUsername ||
      !validPassword ||
      !validPasswordMatch ||
      !validEmail ||
      !validPhoneNumber

    ) {
      console.log("Invalid data");
      set
      return;
    }

    try {
      const response = await axios.post("http://localhost:8000/register", {
        username: formData.username,
        password: formData.password,
        email: formData.email,
        phoneNumber: formData.phoneNumber,
      });
      setMessage(response.data.message);
      setFormData({
        username: "",
        password: "",
        confirmPassword: "",
        email: "",
        phoneNumber: "",
      });
      setValidUsername(true);
      setValidPassword(true);
      setValidPasswordMatch(true);
      setValidEmail(true);
      setValidPhoneNumber(true);
    } catch (error) {
      console.log(error.response.data);
      setMessage(error.response.data.detail);
    }
  };

  return (
    <div>
      <h1>User Registration</h1>
      <form className="form" onSubmit={handleSubmit}>
        <div>
          <label>Username:</label>
          <input
            type="text"
            name="username"
            value={formData.username}
            onChange={handleChange}
            required
          />
          {!validUsername && (
            <p className="errormsg">Username must be at least 6 characters</p>
          )}
        </div>
        <div>
          <label>Password:</label>
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
          {!validPassword && (
            <p className="errormsg">Password must be at least 6 characters</p>
          )}
        </div>
        <div>
          <label>Confirm Password:</label>
          <input
            type="password"
            name="confirmPassword"
            value={formData.confirmPassword}
            onChange={handleChange}
            required
          />
          {!validPasswordMatch && (
            <p className="errormsg">Passwords do not match</p>
          )}
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
          {!validEmail && <p className="errormsg">Invalid email</p>}
        </div>
        <div>
          <label>Phone Number:</label>
          <input
            type="tel"
            name="phoneNumber"
            value={formData.phoneNumber}
            onChange={handleChange}
            required
          />
          {!validPhoneNumber && (
            <p className="errormsg">Phone number must be 11 digits</p>
          )}
        </div>
        <button type="submit">Register</button>
      </form>
      {message && <p className="successmsg">{message}</p>}
    </div>
  );
};

export default App;
